import React from 'react';
import './UserInfo.css';
import ic_user from '../assets/Profile.png';  // 이미지 파일 import

const UserInfo = ({ name, daysManaged }) => {
  return (
    <div className='user-info'>
      <div className='user'>
        <img src={ic_user} alt='user-img' className='user-img'></img>
      </div>
      <div>
        <div>{name} 님</div>
        <div>관리한지 +{daysManaged}일 째</div>
      </div>
    </div>
  );
};

export default UserInfo;
